package com.example.cameraactivity;

import android.Manifest;
import android.graphics.Bitmap;
import android.util.Log;
import android.view.View;
import android.widget.Button;
import androidx.appcompat.app.AppCompatActivity;
import android.os.Bundle;
import androidx.camera.core.CameraSelector;
import androidx.camera.core.Preview;
import androidx.camera.lifecycle.ProcessCameraProvider;
import androidx.camera.view.PreviewView;
import androidx.core.app.ActivityCompat;
import androidx.core.content.ContextCompat;
import com.google.common.util.concurrent.ListenableFuture;

import java.io.ByteArrayOutputStream;
import java.io.IOException;
import java.io.OutputStream;
import java.net.HttpURLConnection;
import java.net.MalformedURLException;
import java.net.ProtocolException;
import java.net.URL;
import java.nio.charset.StandardCharsets;
import java.util.Base64;
import java.util.UUID;

public class CaptureActivity extends AppCompatActivity {
    private PreviewView previewView;
    private Button btnCapture;
    static int id = 0;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.capture_activity);

        ActivityCompat.requestPermissions(this, new String[] {Manifest.permission.CAMERA}, 10);
        btnCapture = findViewById(R.id.btn_capture);
        previewView = findViewById(R.id.previewView);

        ListenableFuture<ProcessCameraProvider> provider = ProcessCameraProvider.getInstance(this);
        provider.addListener(() -> {
            try {
                ProcessCameraProvider pro = provider.get();
                Preview preview = new Preview.Builder().build();
                preview.setSurfaceProvider(previewView.getSurfaceProvider());
                pro.unbindAll();
                pro.bindToLifecycle(this, CameraSelector.DEFAULT_BACK_CAMERA, preview);
            } catch (Exception e) {}
        }, ContextCompat.getMainExecutor(this));

        btnCapture.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                String imgToBase64 = "";
                ByteArrayOutputStream baos = new ByteArrayOutputStream();
                Bitmap bitmap = previewView.getBitmap();
                bitmap.compress(Bitmap.CompressFormat.PNG, 100, baos);
                byte[] byImage = baos.toByteArray();

                if (android.os.Build.VERSION.SDK_INT >= android.os.Build.VERSION_CODES.O) {
                        imgToBase64 = Base64.getEncoder().encodeToString(byImage);
                }
                imgToBase64 = "";
                Log.d("base64", imgToBase64);
                CURLThread curlThread = new CURLThread(imgToBase64);
                curlThread.start();
            }
        });


    }
}